)
};

const Topicdetail =(props)=>{

  console.log(props)
  return (
    <div>
      <h1>topic detail page</h1>
    </div>
  )
}



function App() {
  return (
    <React.Fragment>
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route path="/Topiclist" component={Topiclist} />
        <Route path="/Topiclist/:topicId" component={Topicdetail}/>
      </Switch>
    </React.Fragment>
  );
}

export default App;
